import React, {useState, useEffect} from 'react';
import {
  Button, StyleSheet, Text, View,
    ScrollView,
    Image,
    TouchableOpacity,
    Animated,
    FlatList, 
  Dimensions,
  Alert,
    TextInput,
    Modal
} from 'react-native';




export default function CustomModal(props) { 

    return (
        <>
            <Modal {...props}
                visible={true}
            >
             <Text>I am a  modal.</Text>   
            </Modal>
        </>
    )
}
